        const api_url = await fetch(`https://api.themoviedb.org/3/search/movie?api_key=8bd7ad481d1640e1826b9b2df2461c0f&language=en-US&page=1&include_adult=false&query=3`)
        const data = await api_url.json();
        console.log(data)
        let names = [api_url]
    }


    render() {
        return (
            <div>
        <h3>Films</h3>
                <ul>
                    {this.props.names.map(function (name){
                        return<li>{name}</li>
                    })}
                </ul>
            </div>
        )
    }
}

export default Film;
